import React, { Component } from 'react';

class Logout extends Component {
  render() {
    return (
      <div className="basic" data-test="logout"> 
        <h1>
        </h1>
        <h2>
            You are now logged out of Pi-oT.
        </h2>
      </div>
    );
  }
}

export default Logout;
